import  './Navbar.css';

const Navbar = () => {
  return (
    <nav class="navbar bg-light">
      <div class="container">
        <a class="navbar-brand" href="#">
          <img src="/docs/5.2/assets/brand/bootstrap-logo.svg" alt="" width="30" height="24"/>
        </a>
      </div>
    </nav>
  )
}

export default Navbar
